import React, { Component } from 'react'
import {Carousel} from 'react-bootstrap'
export default class Carousel1 extends Component {
  constructor(props) {
    super(props);
    this.state = {
    data:null

    };

  }
  componentWillUnmount() {
    fetch('https://api.unsplash.com/search/collections?query=coffeeshop&client_id=f99cf5e0d08bf12678d330c367ab611aa362f156833eef8d863708dfcedc70a3')
      .then((response) => response.json())
      .then((responseData) => {
        // console.log(responseData);
        // console.log(this.state.tilte)
        console.log(responseData)

        this.setState({
          data: responseData

        });
      });


  }
    render() {
        return (
            <div>
                           <Carousel>
              <Carousel.Item>
                <img
                  className="d-block w-100"
                  src={this.state.data.results[1].links.self}
                  alt="First slide"
                />

              </Carousel.Item>
              <Carousel.Item>
                <img
                  className="d-block w-100"
                  src="https://img.represent.com/uploads/5231412882392dd1d7b549d119ef1f98.jpg?auto=format&q=93"
                  alt="Third slide"
                />

              </Carousel.Item>

            </Carousel> 
            </div>
        )
    }
}


// https://api.unsplash.com/search/collections?query=coffeeshop&client_id=f99cf5e0d08bf12678d330c367ab611aa362f156833eef8d863708dfcedc70a3
